	public static boolean httpPostWithJson() {
		boolean isSuccess = false;
		String jsonObj = "{"
				+ "\"uid\": \"118.12.0.12\","
				+ "\"idcardImage\": \"\","
				+ "\"faceImage\": \"\""
				+ "}";
		String url = "http://face2idcard.aliapi.hanvon.com/rt/ws/v1/face/faceid/recg?code=1b88a702-7a32-4443-a146-9919c9474cc9";
		HttpPost post = null;
		try {
			HttpClient httpClient = new DefaultHttpClient();

			// 设置超时时间
			// httpClient.getParams().setParameter(CoreConnectionPNames.CONNECTION_TIMEOUT,
			// 2000);
			// httpClient.getParams().setParameter(CoreConnectionPNames.SO_TIMEOUT,
			// 2000);

			post = new HttpPost(url);
			// 构造消息头
			post.setHeader("Content-type", "application/octet-stream");
			// post.setHeader("appid", appid);

			// 构建消息实体
			StringEntity entity = new StringEntity(jsonObj,
					Charset.forName("UTF-8"));
			entity.setContentEncoding("UTF-8");
			// 发送Json格式的数据请求
			entity.setContentType("application/json");
			post.setEntity(entity);

			HttpResponse response = httpClient.execute(post);

			// 检验返回码
			int statusCode = response.getStatusLine().getStatusCode();
			if (statusCode != HttpStatus.SC_OK) {
				System.out.println("请求出错: " + statusCode);
				isSuccess = false;
			} else {
				System.out.println(EntityUtils.toString(response.getEntity()));
			}
		} catch (Exception e) {
			e.printStackTrace();
			isSuccess = false;
		} finally {
			if (post != null) {
				try {
					post.releaseConnection();
					Thread.sleep(500);
				} catch (InterruptedException e) {
					e.printStackTrace();
				}
			}
		}
		return isSuccess;
	}

